import React, { Component } from 'react';
import {Container, Row, Col, Button, Form} from 'react-bootstrap';

class SignUp extends Component {
  constructor(props){
    super(props);
    this.state = {
      index: 0,
      forms: [<AccountSelectionForm grandParent={this.props.parent} parent={this} />,
        <PersonalInfoForm parent={this} />, <LoginCredentialsForm parent={this} />]
    }
  }
  render(){
    return(
      <Row>
        <Col>
          {this.state.forms[this.state.index]}
        </Col>
      </Row>
    )
  }
}



class LoginCredentialsForm extends Component {
  constructor(props){
    super(props)
    this.goBack = this.goBack.bind(this)
  }
  goBack(){
    this.props.parent.setState({
      index: 1
    })
  }

  render(){
    return(
      <Row>
        <Col>
        <Form >
        <Form.Group controlId="formGroupEmail">
  <Form.Label>Email address</Form.Label>
  <Form.Control type="email" placeholder="" />
</Form.Group>
<Form.Group controlId="formGroupPassword">
  <Form.Label>Password</Form.Label>
  <Form.Control type="password" placeholder="" />
</Form.Group>
<Button variant="outline-danger" onClick={this.goBack} >Back</Button>

  <Button variant="outline-dark" type="submit">SUBMIT</Button>
        </Form>
        </Col>
      </Row>

    )
  }

}

class PersonalInfoForm extends Component {
  constructor(props){
    super(props)
    this.goBack = this.goBack.bind(this)
    this.next = this.next.bind(this)
  }
  goBack(){
    this.props.parent.setState({
      index: 0
    })
  }
  next(){
    this.props.parent.setState({
      index: 2
    })
  }

  render(){
    return(
      <Row>
        <Col>
          <Form>
          <Form.Group controlId="formGridFirstName">
            <Form.Label>First Name</Form.Label>
            <Form.Control placeholder="" />
          </Form.Group>
          <Form.Group controlId="formGridLastName">
            <Form.Label>Last Name</Form.Label>
            <Form.Control placeholder="" />
          </Form.Group>
          <Form.Group controlId="formGridAddress" >
            <Form.Label>Address</Form.Label>
            <Form.Control placeholder="" />
          </Form.Group>
          <Form.Group>
            <Form.Label controlId="formGridPhoneNumber">Phone Number</Form.Label>
            <Form.Control placeholder="" />
          </Form.Group>
          <Form.Group>
            <Form.Label controlId="formGridSSN">SSN</Form.Label>
            <Form.Control placeholder="" />
          </Form.Group>
          <Button variant="outline-danger" onClick={this.goBack} >Back</Button>

          <Button variant="outline-dark" onClick={this.next} >NEXT</Button>
          </Form>
        </Col>
      </Row>

    )
  }
}



class AccountSelectionForm extends Component {
  constructor(props){
    super(props)
    this.goBack = this.goBack.bind(this)
    this.next = this.next.bind(this)
  }
  goBack(){
    this.props.grandParent.setState({
      index: "Start"
    })
  }
  next(){
    this.props.parent.setState({
      index: 1
    })
  }
  render(){
    return(
      <Row>
        <Col>
        <Form>
        <Form.Group controlId="exampleForm">
    <Form.Label>What type of account would you like to open today?</Form.Label>
    <Form.Control as="select">
      <option>Checkings</option>
      <option>Savings</option>
      <option>Credit</option>
    </Form.Control>
  </Form.Group>
    <Button variant="outline-danger" onClick={this.goBack} >Back</Button>
  <Button variant="outline-dark" onClick={this.next} >NEXT</Button>

        </Form>
        </Col>
      </Row>

    )
  }
}

export default SignUp

